App.factory('personDAO', function($cordovaSQLite, $q, confGeneralDAO){
	var personDAO = {};

	personDAO.createTable = function(){
		console.log("Create person Table!!!!!");
		$cordovaSQLite.execute(db, "CREATE TABLE IF NOT EXISTS person (user_id text primary key, user_name text, phone integer, address text, img text)");
	};

	personDAO.initData = function(){
		var personList = [
			{ user_id: 'army.qin', user_name: '秦红军', phone: 18126830973, address: '广州海珠区瑞宝花园', img: 'data:image/png;base64,'},
			{ user_id: 'rommy.yang', user_name: '杨涛', phone: 18126830973, address: '广州海珠区瑞宝花园', img: 'data:image/png;base64,'},
			{ user_id: 'lisa.li', user_name: '刘彩丽', phone: 18126830973, address: '广州番禺区天安科技园', img: 'data:image/png;base64,'},
			{ user_id: 'may.li', user_name: '黎小美', phone: 18126830973, address: '广州番禺区洛溪新城', img: 'data:image/png;base64,'},
			{ user_id: 'dennie.chen', user_name: '陈丹', phone: 18126830973, address: '广州海珠区瑞宝花园', img: 'data:image/png;base64,'}
		];

		angular.forEach(personList, function(obj){
			personDAO.insert(obj).then(function(data){
				console.log("Success --> userId = " + obj.user_id + ", return value = " + data);
			}, function(data){
				console.log("Error --> userId = " + obj.user_id + ", return value = " + data);
			}, function(data){
				console.log("Save " + obj.user_id + " data Finaly*******");
			});
		});

		console.log("update confGeneralDAO SqlVersion Value!!!");
		confGeneralDAO.update({param_value: '2', param_name: 'DB_VERSION'})
			.then(function(data){
				console.log("personDAO --> update sql version success!!! -> " + data);
			}, function(data){
				console.log("personDAO --> update sql version error!!! -> " + data);
			});
		console.log("personDAO - initData success");
	};

	personDAO.insert = function(obj){
		var query = "INSERT INTO person(user_id, user_name, phone, address, img) VALUES (?, ?, ?, ?, ?)";
		var deferred = $q.defer();
	    $cordovaSQLite.execute(db, query, [obj.user_id, obj.user_name, obj.phone, obj.address, obj.img])
	    .then(function(res){
	      console.log("personDAO INSERT ID --> " + res.insertId);
	      deferred.resolve(res.insertId);
	    }, function(err){
	      console.log(err);
	      deferred.reject('-1');
	    });
	    return deferred.promise;
	};

	personDAO.selectById = function(userId){
		var query = "SELECT user_id, user_name, phone, address, img FROM person WHERE user_id = ?";
		var deferred = $q.defer();
		$cordovaSQLite.execute(db, query, [userId])
		.then(function(res){
			if(res.rows.length > 0){
				console.log(res.rows.item(0));
				deferred.resolve(res.rows.item(0));
			}else{
				console.log("personDAO - No results found");
				deferred.reject('No results found');
			}
		}, function(err){
			console.log(err);
			deferred.reject('No results found');
		});
		return deferred.promise;
	};

	personDAO.selectAll = function(){
		var query = "SELECT user_id, user_name, phone, address, img FROM person";
		var deferred = $q.defer();
		$cordovaSQLite.execute(db, query, [])
		.then(function(res){
			if(res.rows.length > 0){
				console.log(res.rows.item(0));
				deferred.resolve(res.rows);
			}else{
				console.log("personDAO - No results found");
				deferred.reject('No results found');
			}
		}, function(err){
			console.log(err);
			deferred.reject('No results found');
		});
		return deferred.promise;
	};

	personDAO.fetchAll = function(result){
		var output = [];
		for (var i = 0, len = result.length; i < len; i++) {
	      // console.log(data.item(i).user_id);
	      output.push(result.item(i));
	    }
	    return output;
	};

	return personDAO;
});